package Q76_Minimum_Window_Substring

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

var tcs = []struct {
	s      string
	t      string
	output string
}{
	{
		s:      "abc",
		t:      "abc",
		output: "abc",
	},
	{
		s:      "ADOBECODEBANC",
		t:      "ABC",
		output: "BANC",
	},
	{
		s:      "a",
		t:      "a",
		output: "a",
	},
	{
		s:      "a",
		t:      "aa",
		output: "",
	},
	{
		s:      "aa",
		t:      "aa",
		output: "aa",
	},
	{
		s:      "bbaac",
		t:      "aba",
		output: "baa",
	},
	{
		s:      "aaaaaaaaaaaabbbbbcdd",
		t:      "abcdd",
		output: "abbbbbcdd",
	},
	{
		s:      "",
		t:      "",
		output: "",
	},
}

func Test_nextPermutation(t *testing.T) {
	a := assert.New(t)
	for _, item := range tcs {
		output := minWindow(item.s, item.t)
		a.Equal(item.output, output)
	}
}
